const Main = (props) => {
    const { userList } = props;
    return (
        <div>
            <div>
                <Link to="/search">검색 페이지로</Link>
            </div>
            메인페이지
            <div>{"검색된 사용자 수 => " + userList.length}</div>
        </div>
    );
};

const mapStateToProps = (state) => {
    return { userList: state.userReducer.userList };
};
export default connect(mapStateToProps, null)(Main);
